The query and the question are not identical. 

The query is looking for the author of "Harry Potter" (wd:Q8337) with property "author" (wdt:P50), but the question asks "¿Quién escribió Harry Potter?" which translates to "Who wrote Harry Potter?". 

The correct query for the question would be: SELECT DISTINCT ?uri WHERE { wd:Q8337 wdt:P50 ?uri . }

However, the label for "author" is "autor" in the query, which is the Spanish translation. If the query is intended for an English-speaking audience, the correct label for "author" would be "author" or "P31". 

The correct query with a likely more internationally understood property (P51) would be: SELECT DISTINCT ?uri WHERE { wd:Q8337 wdt:P51 ?uri . }
